import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { useTranslation } from "react-i18next";

import { couponApi, rewardApi } from "@api";
import { ComponentRewardList } from "@components";
import { ICouponList } from "@interfaces";
import { setLoading } from "@redux";
import { enumStatus, enumTypes } from "@configs";
import { useNotify } from "@utils";

export const ModulesReward = () => {
    //page hooks
    const { t } = useTranslation();
    const dispatch = useDispatch();
    //page state
    const [reward, setReward] = useState<ICouponList[]>([]);

    useEffect(() => {
        (async () => {
            dispatch(setLoading(true));
            const res = await rewardApi.getListReward();
            const data = res.data.docs as ICouponList[];
            console.log(data);
            setReward(data);
            dispatch(setLoading(false));
        })();
    }, []);

    return <>{reward && <ComponentRewardList />}</>;
};
